import React from 'react';
import ReactDOM from 'react-dom';


//import * as serviceWorker from './serviceWorker';

const App = ()  => {

  const now = new Date()
  const a = 10
  const b = 1.5
  return (
  <div>
    <p>Hello world</p>
    <p>
      {a} plus {b} is {a+b}
    </p>
  </div>
)
}
ReactDOM.render(<App />, document.getElementById('root'))
